script: |
  super -f text -I q920.spq | sort > q920.out

inputs:
  - name: q920.spq
    data: |
      SELECT + + col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( - - 85 ) * - col0 - + + col0 * + 29 BETWEEN col2 AND NULL;
  - name: tab1

outputs:
  - name: q920.out
    data: |
      14
      47
      5
